(window.webpackJsonp=window.webpackJsonp||[]).push([[871],{1226:function(n,h,t){"use strict";t.r(h);var i=t(44),c=Object(i.a)({},(function(){var n=this,h=n.$createElement,t=n._self._c||h;return t("ContentSlotsDistributor",{attrs:{"slot-key":n.$parent.slotKey}},[t("h1",{attrs:{id:"chuong-1758-nhan-thanh-co-thanh-【-canh-thu-hai-】"}},[t("a",{staticClass:"header-anchor",attrs:{href:"#chuong-1758-nhan-thanh-co-thanh-【-canh-thu-hai-】"}},[n._v("#")]),n._v(" Chương 1758: Nhan Thanh Cổ Thánh 【 canh thứ hai 】")]),n._v(" "),t("hr"),n._v(" "),t("p",[n._v("Chương 1758: Nhan Thanh Cổ Thánh "),t("br"),t("br"),n._v("Nhìn nữ hài mặt không hề cảm xúc, Trương Huyền lông mày nhảy dựng, đi tới trước mặt: “Vừa rồi tại Tẩm điện gặp phải, sau đó liền cùng Ngụy Như Yên cùng một chỗ mang ra ngoài...”"),t("br"),t("br"),n._v("“Đi thôi!”"),t("br"),t("br"),n._v("Lạc Nhược Hi thân thể mềm mại vụt qua, đi đầu hướng chủ điện phương hướng bay đi."),t("br"),t("br"),n._v("“Cái này...”"),t("br"),t("br"),n._v("Gãi đầu một cái, Trương Huyền vội vàng đi theo."),t("br"),t("br"),n._v("Chủ điện điểm số điện càng thêm hùng vĩ, phía trước là cái to lớn quảng trường, giờ phút này đã chất đầy người."),t("br"),t("br"),n._v("Trước đó, tại rất nhiều thế giới vây khốn vô số cường giả, rất lớn một bộ phận, đều chạy tới, lít nha lít nhít chừng mấy ngàn."),t("br"),t("br"),n._v("Coi như không cách nào đi vào chủ điện, có thể tận mắt nhìn đến, Xuân Thu đại điển thần kỳ, cũng tuyệt đối chuyến đi này không tệ."),t("br"),t("br"),n._v("“Chủ nhân, ta đã khôi phục ký ức, sáu đại phân điện toàn bộ mở ra, mới có thể kích hoạt chủ điện bên trên phong ấn...”"),t("br"),t("br"),n._v("Tiểu Phù Phù thanh âm vang lên: “Ta có thể mang chủ nhân đi vào, có điều, hiện tại, còn không có mở ra!”"),t("br"),t("br"),n._v("“Ừm!” Thấy cái này hai hàng, giờ phút này mới khôi phục ký ức, Trương Huyền bất đắc dĩ lắc đầu, mấy bước đi tới Lạc Nhược Hi trước mặt, thấy nữ hài vẫn lạnh lùng như cũ như băng, cũng nhịn không được nữa nói: “Cái này... Ta thật chỉ là ngẫu nhiên gặp...”"),t("br"),t("br"),n._v("Lạc Nhược Hi vừa định nói chuyện, liền nghe đến một cái hưng phấn mà thanh âm vang lên."),t("br"),t("br"),n._v("“Trương sư, ta liền biết ngươi nhất định sẽ tới...”"),t("br"),t("br"),n._v("Ngay sau đó, một thân ảnh vội vã đi tới trước mặt, một mặt hưng phấn."),t("br"),t("br"),n._v("“Phi nhi, ngươi cũng tới...”"),t("br"),t("br"),n._v("Lạc Thất Thất con mắt cũng là sáng lên."),t("br"),t("br"),n._v("Không phải người khác, chính là bạn tốt của nàng, Huyễn Vũ đế quốc công chúa, Ngọc Phi Nhi!"),t("br"),t("br"),n._v("“Ta đã biết, có thể bái Kỷ lão sư vi sư, là nguyên nhân của ngươi...”"),t("br"),t("br"),n._v("Nhìn thấy ngày xưa người bạn thân này, Ngọc Phi Nhi tràn đầy cảm kích."),t("br"),t("br"),n._v("Nàng chỉ là Huyễn Vũ đế quốc một cái nho nhỏ công chúa, có thể được đến Danh Sư đường Tổng bộ trưởng lão Kỷ Nhược Trần ưu ái, thu làm thân truyền, đương nhiên là vị này tiểu công chúa đề nghị."),t("br"),t("br"),n._v("Nếu không, lại có thiên tư, cũng không có người biết ah!"),t("br"),t("br"),n._v("“Không cần khách khí...” Lạc Thất Thất cười cười."),t("br"),t("br"),n._v("Hàn huyên đôi câu, Ngọc Phi Nhi thân thể mềm mại vặn một cái, đi tới Trương Huyền trước mặt, trong mắt mang theo vẻ phức tạp: “Trương sư... Đã lâu không gặp!”"),t("br"),t("br"),n._v("Nàng đối trước mắt vị này cũng có đặc thù tình cảm, nhưng Lạc Thất Thất gặp phải, đã nghe được, rõ ràng cùng đối phương, lại không bất kỳ khả năng, trong lòng mặc dù tràn đầy không cam lòng, vẫn như cũ mặt mỉm cười."),t("br"),t("br"),n._v("“Đã lâu không gặp...” Trương Huyền gãi đầu một cái, quay đầu nhìn về phía bên người Lạc Nhược Hi: “Ngươi nhìn... Thật sự là ngẫu nhiên gặp...”"),t("br"),t("br"),n._v("Nhìn thấy hắn cái bộ dáng này, muốn giải thích cũng không biết nói như thế nào bộ dáng, Lạc Nhược Hi mỉm cười, cũng không nói chuyện, tiếp tục hướng phía trước nhìn lại."),t("br"),t("br"),n._v("Chủ điện bên ngoài trên quảng trường, giờ phút này đã chia làm bốn phe cánh, Danh Sư đường cùng rất nhiều gia tộc cùng một chỗ, Chư Tử bách gia, Dị Linh tộc nhân cùng rất nhiều Thánh thú."),t("br"),t("br"),n._v("Tứ phương đều có không ít người, tích tụ cùng một chỗ, riêng phần mình đề phòng."),t("br"),t("br"),n._v("Trương Huyền hướng bốn phía nhìn lại, cẩn thận cảm thụ, quả nhiên cảm giác được vô số khí tức cường đại, ẩn giấu ở xung quanh."),t("br"),t("br"),n._v("Bốn phía thế lực lớn có thể yên tĩnh ở chung, nhất định là bọn họ lẫn nhau chấn nhiếp kết quả."),t("br"),t("br"),n._v("“Sư huynh...”"),t("br"),t("br"),n._v("Đang muốn nhìn một chút có thể hay không tìm cơ hội, lại trảm cái Cổ Thánh hai cái, làm chút máu tươi, liền nghe đến tiếng la vang lên, quay đầu nhìn lại, chỉ thấy Dương sư mỉm cười bay tới."),t("br"),t("br"),n._v("“Ngươi... Đột phá đến Cổ Thánh?”"),t("br"),t("br"),n._v("Sửng sốt một chút, Trương Huyền ánh mắt sáng lên."),t("br"),t("br"),n._v("Trước mắt Dương sư, trong cơ thể khí tức mơ hồ, nhìn không ra sâu cạn, chợt nhìn, chỉ so với bản thân cao một đường, nhưng nhìn kỹ lại, lại giống như là mênh mông biển lớn, không biết Bỉ Ngạn ở nơi nào."),t("br"),t("br"),n._v("Không cần nghĩ, cũng biết, vị sư đệ này, hẳn là đạt được một loại nào đó kỳ ngộ, trước hết nhất đột phá đến Cổ Thánh cấp bậc."),t("br"),t("br"),n._v("“Vận khí không tệ, may mắn mà thôi!” Dương sư mỉm cười."),t("br"),t("br"),n._v("Khổng miếu mở ra, hắn tự nhiên cũng tới, cơ duyên tốt hơn, một lần đột phá tha thiết ước mơ ràng buộc, đạt đến loại cảnh giới này."),t("br"),t("br"),n._v("“Tu luyện không có may mắn...” Trương Huyền gật đầu."),t("br"),n._v(" Dương sư đã sớm đạt đến Bất Hủ cảnh đại viên mãn, một mực chu du thiên hạ, mục đích đúng là vì tìm kiếm Cổ Thánh chi khí, tìm kiếm cơ duyên, giờ phút này Khổng miếu mở ra, cơ duyên đi tới, có thể đột phá, đương nhiên."),t("br"),t("br"),n._v("“Chư vị...”"),t("br"),t("br"),n._v("Nhưng vào lúc này, một cái âm thanh vang dội vang lên."),t("br"),t("br"),n._v("Đám người đồng loạt nhìn lại, ngay sau đó nhìn thấy chủ điện trước mặt hư không chỗ, một cái già cỗi bóng người bất ngờ xuất hiện."),t("br"),t("br"),n._v("“Là Chư Tử bách gia Cổ Thánh!”"),t("br"),t("br"),n._v("Đối phương quần áo, cùng Chư Tử bách gia giống nhau như đúc, không cần nghĩ, cũng biết, là đối phương siêu cấp cường giả."),t("br"),t("br"),n._v("“Chủ điện đã mở ra, mọi người cũng không cần thiết che giấu, đều đi ra đi!”"),t("br"),t("br"),n._v("Thanh âm vang vọng bốn phía."),t("br"),t("br"),n._v("“Không sai, không cần thiết giấu!”"),t("br"),t("br"),n._v("“Tất cả mọi người vì chủ điện mà đến, nếu đã xuất hiện, cất giấu cũng không có cái gì ý nghĩa...”"),t("br"),t("br"),n._v("“Ra đi...”"),t("br"),t("br"),n._v("Ầm ầm!"),t("br"),t("br"),n._v("Kèm theo từng cái thanh âm vang lên, ngay sau đó trên không bất ngờ xuất hiện mấy chục bóng người."),t("br"),t("br"),n._v("Mỗi cái đội ngũ trên không, đều có sáu, bảy cái nhiều."),t("br"),t("br"),n._v("“Nhiều như vậy?”"),t("br"),t("br"),n._v("Trương Huyền lông mày nhảy dựng."),t("br"),t("br"),n._v("Vốn cho rằng, lần này có thể có bảy, tám cái Cổ Thánh tới, là tốt lắm rồi, không nghĩ tới một chút hơn hai mươi người."),t("br"),t("br"),n._v("Vị kia trước đó bị hắn thương tổn gia hỏa, bất ngờ đứng sừng sững trong đó."),t("br"),t("br"),n._v("Cổ Thánh tới đây mục đích, chính là vì Xuân Thu đại điển, trước đó phân điện mở ra, có thể trốn ở bốn phía, bảo vệ tộc nhân, đừng để hắn bị thương tổn, mà giờ khắc này, chủ điện mở ra, tương đương với thắng trình đến điểm cuối cùng, tiếp tục che giấu đã không còn ý nghĩa."),t("br"),t("br"),n._v("“Đi qua sáu đại phân điện, chư vị chắc hẳn đã suy tính không sai biệt lắm, biết chủ điện tuy là xuất hiện, nhưng khoảng cách chân chính mở ra, còn cần nhất đạo cực kỳ trọng yếu thủ tục!”"),t("br"),t("br"),n._v("Chư Tử bách gia Cổ Thánh, nói."),t("br"),t("br"),n._v("“Là cần sau cùng thủ tục, Nhan Thanh Cổ Thánh, chúng ta nơi này, thực lực của ngươi mạnh nhất, ngươi nói làm sao bây giờ đi!”"),t("br"),t("br"),n._v("Một vị Dị Linh tộc nhân Cổ Thánh nói."),t("br"),t("br"),n._v("“Nhan Thanh Cổ Thánh? Chẳng lẽ cũng là Tử Uyên Cổ Thánh hậu nhân?”"),t("br"),t("br"),n._v("Trương Huyền nhíu nhíu mày."),t("br"),t("br"),n._v("Tử Uyên Cổ Thánh, bảy mươi hai Thánh đứng đầu, Khổng sư thân truyền đại đệ tử, Nhan Tiết chính là con cháu đời sau, vị này gọi bộ mặt xanh, làm không cẩn thận là Nhan Tiết tiền bối."),t("br"),t("br"),n._v("“Sư đệ, ngươi có thể biết vị này Nhan Thanh Cổ Thánh?”"),t("br"),t("br"),n._v("Trương Huyền lặng lẽ truyền âm."),t("br"),t("br"),n._v("“Không nhận ra... Chúng ta Danh Sư đường, cùng Chư Tử bách gia, mặc dù cùng thuộc Khổng sư truyền thừa, lại từ trước tới nay rất ít lui tới...” Trên không Dương sư, truyền âm tới."),t("br"),t("br"),n._v("“Ngươi không nhận ra... Dị Linh tộc nhân lại một cái hô lên...” Trương Huyền nhíu nhíu mày."),t("br"),t("br"),n._v("Danh Sư đường, địa vị cao nhất Dương sư, cũng không nhận ra vị này Nhan Thanh Cổ Thánh, Dị Linh tộc nhân lại trực tiếp xưng hô, hơn nữa biết thực lực của hắn mạnh nhất..."),t("br"),t("br"),n._v("Nói không kỳ quái, đó là giả."),t("br"),t("br"),n._v("“Còn có thể làm sao, đã đều đến nơi này, đương nhiên là người gặp có phần! Chúng ta Thánh thú nhất tộc, hiện tại cái gì đều không có đạt được, các ngươi ai muốn ném xuống chúng ta mặc kệ, vậy thì... Cá chết lưới rách!”"),t("br"),t("br"),n._v("Một đầu to lớn Thánh thú hừ lạnh."),t("br"),t("br"),n._v("Đầu thánh thú này, cũng đã đạt đến Cổ Thánh cấp bậc, thân thể không gian bốn phía tựa như ngưng kết."),t("br"),t("br"),n._v("“Bạch tôn giả trước đừng có gấp, ta để mọi người đi ra, không phải là xác định chuyện này ư? Như thế nào đi vào chủ điện, danh ngạch phân chia như thế nào, chúng ta có thể thương nghị đến, còn sau khi tiến vào, ai có thể đạt được cơ duyên, cơ duyên lại là cái gì, liền mỗi người dựa vào tạo hóa!”"),t("br"),t("br"),n._v("Nhan Thanh Cổ Thánh cười cười."),t("br"),t("br"),n._v("(Mở một ngày xe, đuổi đến 1 600 dặm đường, mệt tê liệt, chỉ viết hai canh, còn lại ban ngày bổ. Tiếp tục cầu nguyệt phiếu, có, xin bầu cho lão nhai, cảm tạ!)"),t("br"),t("br"),n._v("Người đăng: ThấtDạ"),t("br"),t("br"),t("br"),t("br")]),n._v(" "),t("hr"),n._v(" "),t("p",[t("a",{attrs:{href:"./chap-1769"}},[n._v("Chương trước")]),n._v("  |  "),t("a",{attrs:{href:"./chap-1771"}},[n._v("Chương sau")])])])}),[],!1,null,null,null);h.default=c.exports}}]);